import { SIGN_UP } from './authTypes';
import axios from 'axios';

export const signUp = () => {
	return (dispatch) => {
		axios.post('http://localhost:3000/signup', {}).then((res) => {
			const user = res.data.user;
			dispatch(signUp(user));
		});
	};
};
